import Card from './Card';

export default function Cards({characters}) { //recibe todos los personajes
   return (
   <div>
      {characters.map(element => {   //recorro los personajes y creo las caracteristicas para cada uno
         return (
         <Card 
            key= {element.idex}
            id={element.id}
            name={element.name}
            status={element.status}
            species={element.species}
            gender={element.gender}
            origin={element.origin.name}
            image={element.image}
            onClose={() => window.alert('Emulamos que se cierra la card')}
         ></Card>
         );
      })}
   </div>)
}
